import { createDrawerNavigator } from "@react-navigation/drawer";
import { NavigationContainer } from "@react-navigation/native";
import { TouchableOpacity, View, Text, StyleSheet } from "react-native";
import MessagesScreen from './MessagesScreen.js'; // 导入 MessagesScreen
import NewScreen from './WeatherScreen.js'; // NewScreen
import MoodScreen from './MoodScreen.js'; // NewScreen
import Video from 'react-native-video';

function HomeScreen({ navigation }) {
  return (
    <View style={styles.homeContainer}>
      <Video
        source={require('./asserts/bunny.mp4')}
        style={StyleSheet.absoluteFillObject}
        muted={true}
        repeat={true}
        resizeMode="cover"
      />
      <TouchableOpacity style={styles.homeButton} onPress={navigation.openDrawer}>
        <Text style={styles.homeButtonText}>Open navigation drawer</Text>
      </TouchableOpacity>
      <TouchableOpacity style={styles.homeButton} onPress={() => navigation.navigate('Message to Fife Rabbits')}>
        <Text style={styles.homeButtonText}>Go to Message to Fife Rabbits</Text>
      </TouchableOpacity>
      <TouchableOpacity style={styles.homeButton} onPress={() => navigation.navigate('Environment')}>
        <Text style={styles.homeButtonText}>Go to check the Fife environment</Text>
      </TouchableOpacity>
      <TouchableOpacity style={styles.homeButton} onPress={() => navigation.navigate('Mood Color')}>
        <Text style={styles.homeButtonText}>Go to send you color of moods</Text>
      </TouchableOpacity>
    </View>
  );
}

const Drawer = createDrawerNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Drawer.Navigator initialRouteName="Home">
        <Drawer.Screen name="Home" component={HomeScreen} />
        <Drawer.Screen name="Message to Fife Rabbits" component={MessagesScreen} />
        <Drawer.Screen name="Mood Color" component={MoodScreen} />
        <Drawer.Screen name="Environment" component={NewScreen} />
      </Drawer.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  homeContainer: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  homeButton: {
    width: 250,
    height: 50,
    margin: 5,
    backgroundColor: '#007AFF',
    alignItems: 'center',
    justifyContent: 'center',
    borderRadius: 5,
  },
  homeButtonText: {
    color: 'white',
    fontSize: 16,
  },
});
